import React from "react";
import './main.css';

const Upward = () => {
  return (
    <div class="arrow" id="arrow">
      <a href="#home">
        <i class="fa fa-arrow-up" aria-hidden="true"></i>
      </a>
    </div>
  );
};

export default Upward;
